  `errorParameters` varchar(40) NOT NULL,
  PRIMARY KEY (`errorlog_id`),
  KEY `vendor_id` (`vendor_id`)
) ENGINE=InnoDB AUTO_INCREMENT=52 DEFAULT CHARSET=utf8;

